// frontend/src/components/AssetForm.js
import React, { useEffect, useState } from 'react';

const AssetForm = ({ onSave, lastAssetData }) => {
  const [formData, setFormData] = useState({
    actionOwner: '',
    plannedCompletionDate: '',
    actionStatus: '',
    riskStatus: '',
    riskIdentificationDate: '',
    riskAddressedDate: '',
    reviewedBy: '',
    remarks: '',
    nextReviewDate: '',
    selectedAsset: ''
  });

  const [sameAsPrevious, setSameAsPrevious] = useState(false);

  useEffect(() => {
    if (sameAsPrevious && lastAssetData) {
      setFormData(lastAssetData);
    }
  }, [sameAsPrevious, lastAssetData]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({ ...prevState, [name]: value }));
  };

  const handleAddAsset = () => {
    onSave(formData);
    setSameAsPrevious(false);
    setFormData(sameAsPrevious ? formData : {
      actionOwner: '',
      plannedCompletionDate: '',
      actionStatus: '',
      riskStatus: '',
      riskIdentificationDate: '',
      riskAddressedDate: '',
      reviewedBy: '',
      remarks: '',
      nextReviewDate: '',
      selectedAsset: ''
    });
  };

  return (
    <div className="form-container">
      <div className="row">
        <div className="input-group">
          <label>Action Owner</label>
          <input 
            type="text" 
            name="actionOwner" 
            value={formData.actionOwner} 
            onChange={handleInputChange} 
            placeholder="Enter Action Owner" 
          />
        </div>
        <div className="input-group">
          <label>Planned Action Completion Date</label>
          <input 
            type="date" 
            name="plannedCompletionDate" 
            value={formData.plannedCompletionDate} 
            onChange={handleInputChange} 
          />
        </div>
      </div>

      <div className="row">
        <div className="input-group">
          <label>Action Status</label>
          <input 
            type="text" 
            name="actionStatus" 
            value={formData.actionStatus} 
            onChange={handleInputChange} 
            placeholder="Enter Action Status" 
          />
        </div>
        <div className="input-group">
          <label>Risk Status</label>
          <input 
            type="text" 
            name="riskStatus" 
            value={formData.riskStatus} 
            onChange={handleInputChange} 
            placeholder="Enter Risk Status" 
          />
        </div>
      </div>

      <div className="row">
        <div className="input-group">
          <label>Risk Identification Date</label>
          <input 
            type="date" 
            name="riskIdentificationDate" 
            value={formData.riskIdentificationDate} 
            onChange={handleInputChange} 
          />
        </div>
        <div className="input-group">
          <label>Risk Addressed Date</label>
          <input 
            type="date" 
            name="riskAddressedDate" 
            value={formData.riskAddressedDate} 
            onChange={handleInputChange} 
          />
        </div>
      </div>

      <div className="row">
        <div className="input-group">
          <label>Reviewed and Accepted By</label>
          <input 
            type="text" 
            name="reviewedBy" 
            value={formData.reviewedBy} 
            onChange={handleInputChange} 
            placeholder="Enter Reviewer" 
          />
        </div>
        <div className="input-group">
          <label>Remarks</label>
          <input 
            type="text" 
            name="remarks" 
            value={formData.remarks} 
            onChange={handleInputChange} 
            placeholder="Enter Remarks" 
          />
        </div>
      </div>

      <div className="row">
        <div className="input-group">
          <label>Next Review Date</label>
          <input 
            type="date" 
            name="nextReviewDate" 
            value={formData.nextReviewDate} 
            onChange={handleInputChange} 
          />
        </div>
        <div className="input-group checkbox-group">
          <label>Same As Previous</label>
          <input 
            type="checkbox" 
            checked={sameAsPrevious} 
            onChange={() => setSameAsPrevious(!sameAsPrevious)} 
          />
        </div>
      </div>

      {/* Add Asset and Generate Report Buttons */}
      <div className="button-row">
        <button className="add-asset-button" onClick={handleAddAsset}>Add Asset</button>
        <button className="generate-report-button">Generate Report</button>
      </div>
    </div>
  );
};

export default AssetForm;
